import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://localhost:25000/data')
            .then(response => response.json())
            .then(data => {
                console.log(data); // Adicione este log
                setData(data);
            })
            .catch(error => console.error("Erro ao buscar os dados:", error));
    }, []);

    if (data.length === 0) {
        return <div>Loading...</div>;
    }

    return (
        <div className="App">
            <h1>Car List</h1>
            <table>
                <thead>
                    <tr>
                        <th>Modelo</th>
                        <th>Marca</th>
                        <th>Ano</th>
                        <th>Categoria</th>
                        <th>Disponibilidade</th> {/* Nova coluna */}
                    </tr>
                </thead>
                <tbody>
                    {Array.isArray(data) && data.map(car => (
                        <tr key={car.id}>
                            <td>{car.modelo}</td>
                            <td>{car.marca}</td>
                            <td>{car.ano}</td>
                            <td>{car.categoria}</td>
                            <td>{car.disponibilidade ? 'Disponível' : 'Indisponível'}</td> {/* Exibe disponibilidade */}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}    

export default App;
